import React from "react";
import { Tabs, Tab } from "react-bootstrap-tabs";
import { Container } from "react-bootstrap";
import AddNewsTab from './AddNewsTab'

function EditorTabContain() {
  return (
    <div>
      <Tabs
        style={{
          
          border: "4px solid #8395a7",
          backgroundColor: "#656D78",
        }}
        headerStyle={{ fontWeight: "normal", color: "white", border: "2px" ,cursor: "pointer",fontSize:16,}}
        activeHeaderStyle={{ color: "#6D214F", backgroundColor:'white' }}
        contentStyle={{ backgroundColor: "#a4b0be" }}
      >
        <Tab label="Add News data">
          <div style={{ minHeight: "80vh", paddingTop: 30, paddingLeft: 30 }}>
            <AddNewsTab />
          </div>
        </Tab>
        <Tab label="Add falano 1">
          <div style={{ minHeight: "80vh", paddingTop: 30, paddingLeft: 30 }}>
            <h2>Add news 1</h2>
          </div>
        </Tab>
        <Tab label="Add falano 2">
          <div style={{ minHeight: "80vh", paddingTop: 30, paddingLeft: 30 }}>
            <h2>Add news 2</h2>
          </div>
        </Tab>
      </Tabs>
    </div>
  );
}

export default EditorTabContain;
